import ProductListItem from "./ProductListItem";

function ProductList({ items }) {
  console.log(items);
  for (const item in items) {
    return (
      <>
        <div>{item}</div>
        <ul>
          <li>
            <ProductListItem item={item} />
          </li>
        </ul>
      </>
    );
  }
}

export default ProductList;
